const express = require("express")
const bountyRouter = express.Router()
const {v4:uuidv4} = require("uuid")


const bounties = [
    {
        firstName: "Shaggy",
        lastName: "Rogers",
        isAlive: "false",
        bountyAmount: 9500,
        image: "https://pbs.twimg.com/profile_images/3752139484/18cfebbb98af2d28807ffada43351106_400x400.jpeg",
        _id: uuidv4()
    },
    {
        firstName: "Helga",
        lastName: "Pataki",
        isAlive: "true",
        bountyAmount: "5000",
        image: "data:image/jpeg;base64,",
        _id: uuidv4()
    },
    {
        firstName: "Dexter",
        lastName: "McPherson",
        isAlive: "true",
        bountyAmount: "10000",
        image: "data:image/png;base64,",
        _id: uuidv4()
    },
    {
        firstName: "Johnny",
        lastName: "Bravo",
        isAlive: "true",
        bountyAmount: "500",
        image: "data:image/png;base64,",
        _id: uuidv4()
    },
    {
        firstName: "Buttercup",
        lastName: "X",
        isAlive: "true",
        bountyAmount: "50000",
        image: "data:image/jpeg;base64,",
        _id: uuidv4()
    }
]
bountyRouter.get("/",(req,res)=>{
    res.send(bounties)
})

bountyRouter.post("/",(req,res)=>{
        req.body._id = uuidv4()
        bounties.push(req.body)
        res.send(`You added ${req.body.firstName} ${req.body.lastName} to your hitlist`)

    })
bountyRouter.delete("/:bountyId",(req, res)=>{
    const bountyId = req.params.bountyId
    const bountyIndex = bounties.findIndex(bounty => bounty._id===bountyId)
    bounties.splice(bountyIndex, 1)
    res.send(`you successfully eleminiated a target`)
    })
bountyRouter.put("/:bountyId",(req, res)=>{
    const bountyId = req.params.bountyId
    const bountyIndex = bounties.findIndex(bounty => bounty._id===bountyId)
    const updatedBounty = Object.assign(bounties[bountyIndex], req.body)
    res.send(updatedBounty)
    })

    module.exports = bountyRouter